column12:
'Il Governo, con la firma del DPCM del 4 marzo, mira a ridurre gli assembramenti su tutto il territorio nazionale, Di seguito sono elencati i punti principali del provvedimento:
- Sono sospesi i congressi, le riunioni, i meeting e gli eventi sociali, in cui v coinvolto personale sanitario o personale incaricato dello svolgimento di servizi pubblici essenziali o di pubblica utilitv;
- Sono sospese le manifestazioni, gli eventi e gli spettacoli di qualsiasi natura;
- Sono sospesi altresv gli eventi e le competizioni sportive di ogni ordine e disciplina, svolti in ogni luogo, sia pubblico sia privato. Resta comunque consentito lo svolgimento dei predetti eventi e competizioni.'https://www.politicovid.com/italia;http://www.governo.it/it/articolo/coronavirus-firmato-il-dpcm-4-marzo-2020/14241

